import axios from "axios";

axios.get('https://65d8e520c96fbb24c1bc7907.mockapi.io/api/test/users', {
})
.then(function (response) {
  console.log(response);
})
.catch(function (error) {
  console.log(error);
})
.finally(function () {
  // always executed
});
